    max-width: none;
  }
}

.cart-item img {
  height: 100%;
  border-radius: 0.5rem;
  object-fit: cover;
}

.cart-item .more-info {
  margin-top: 0.75rem;
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  justify-content: space-between;
  gap: 0.5rem;
}

@media (min-width: 400px){
  .cart-item .more-info{
    margin-top: auto;
    gap: 0.25rem;
  }
}

.cart-item .size {
  display: inline-block;
  border-radius: 0.5rem;
  border-width: 2px;
  --tw-bg-opacity: 1;
  background-color: rgba(255, 255, 255, var(--tw-bg-opacity));
  padding-left: 0.75rem;
  padding-right: 0.75rem;
  padding-top: 0.25rem;
  padding-bottom: 0.25rem;
  font-size: 0.875rem;
  line-height: 1.25rem;
  font-weight: 700;
}

.cart-item label {
  font-size: 0.875rem;
  line-height: 1.25rem;
  font-weight: 500;
}

@media (min-width: 768px){
  .cart-item label{
    font-size: 1rem;
    line-height: 1.5rem;
  }
}

.cart-item input {
  width: 4rem;
  border-radius: 0.5rem;
  border-width: 1px;
  --tw-border-opacity: 1;
  border-color: rgba(229, 231, 235, var(--tw-border-opacity));
  padding-left: 0.5rem;
  padding-right: 0.5rem;
  padding-top: 0.5rem;
  padding-bottom: 0.5rem;
}

.cart-item button {
  border-bottom-width: 1px;
  border-color: transparent;
}

.cart-item button:hover{
  --tw-border-opacity: 1;
  border-color: rgba(248, 113, 113, var(--tw-border-opacity));
}

.cart-item button{
  font-size: 0.875rem;
  line-height: 1.25rem;
  --tw-text-opacity: 1;
  color: rgba(249, 83, 86, var(--tw-text-opacity));
  transition-property: background-color, border-color, color, fill, stroke, opacity, box-shadow, transform, filter, backdrop-filter;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
  transition-duration: 300ms;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
}

@media (min-width: 768px){
  .cart-item button{
    font-size: 1rem;
    line-height: 1.5rem;
  }
}

/* =============
   About Page
   =============*/

.about-item {
  align-items: center;
  display: grid;
  gap: 2rem;
}

@media (min-width: 768px){
  .about-item{
    grid-template-columns: repeat(2, minmax(0, 1fr));
  }
}

@media (min-width: 1024px){
  .about-item{
    gap: 4rem;
  }
}

.about-item img {
  height: 100%;
  border-radius: 0.5rem;
  object-fit: cover;
  --tw-shadow: 0 1px 3px 0 rgba(0, 0, 0, 0.1), 0 1px 2px 0 rgba(0, 0, 0, 0.06);
  box-shadow: var(--tw-ring-offset-shadow, 0 0 #0000), var(--tw-ring-shadow, 0 0 #0000), var(--tw-shadow);
}

.about-item p {
  margin-top: 1rem;
  font-size: 1rem;
  line-height: 1.5rem;
  --tw-text-opacity: 1;
  color: rgba(75, 85, 99, var(--tw-text-opacity));
}

@media (min-width: 1024px){
  .about-item p{
    margin-top: 2rem;
    font-size: 1.25rem;
    line-height: 1.75rem;
  }
}

/* Profile */

.profile {
  display: grid;
  max-width: 20rem;
  grid-template-columns: max-content repeat(2, 1fr);
  align-items: center;
  gap: 1rem;
}

@media (min-width: 768px){
  .profile{
    grid-template-columns: none;
  }
}

@media (min-width: 1024px){
  .profile{
    grid-template-columns: max-content repeat(2, 1fr);
    gap: 1.5rem;
  }
}

.profile > :first-child {
  order: 9999;
}

.profile h3 {
  font-size: 1.25rem;
  line-height: 1.75rem;
  font-weight: 700;
}

.profile p {
  margin-top: 0.25rem;
  font-size: 0.875rem;
  line-height: 1.25rem;
  --tw-text-opacity: 1;
  color: rgba(75, 85, 99, var(--tw-text-opacity));
}

.profile img {
  height: 5rem;
  width: 5rem;
  border-radius: 9999px;
  object-fit: cover;
}

/* =============
   City Page
   =============*/

.destination-hero {
  margin-top: 2rem;
  display: grid;
  gap: 1rem;
}

@media (min-width: 640px){
  .destination-hero{
    max-height: 24rem;
    grid-template-columns: repeat(5, minmax(0, 1fr));
    grid-template-rows: repeat(4, minmax(0, 1fr));
  }
}

@media (min-width: 768px){
  .destination-hero{
    margin-top: 4rem;
  }
}

.destination-hero .hero-image {
  height: 100%;
  width: 100%;
  border-radius: 0.5rem;
  object-fit: cover;
}

@media (min-width: 640px){
  .destination-hero .hero-image-1{
    grid-column: span 3 / span 3;
    grid-row: span 4 / span 4;
  }
}

@media (min-width: 640px){
  .destination-hero .hero-image-2{
    grid-column: span 2 / span 2;
    grid-row: span 2 / span 2;
  }
}

@media (min-width: 640px){
  .destination-hero .hero-image-3{
    grid-column: span 2 / span 2;
    grid-row: span 2 / span 2;
  }
}

/* Carousel */

/* Needed to add this so I could customize scrollbar */

.carousel::-webkit-scrollbar {
  width: 16px;
}

.carousel::-webkit-scrollbar-track {
  background: #f3f4f6;
  border-radius: 8px;
}

.carousel::-webkit-scrollbar-thumb {
  border-radius: 8px;
  background: #d1d5db;
  box-shadow: inset 2px 2px 2px hsl(0deg 0% 100% / 25%),
    inset -2px -2px 2px rgb(0 0 0 / 25%);
}

.carousel-card {
  min-width: 15.5rem;
  position: relative;
}

.carousel-card .image {
  height: 12rem;
  overflow: hidden;
  border-radius: 0.5rem;
  --tw-bg-opacity: 1;
  background-color: rgba(255, 255, 255, var(--tw-bg-opacity));
}

.carousel-card img {
  height: 100%;
  width: 100%;
  object-fit: cover;
}

.carousel-card img:hover{
  opacity: 0.9;
}

.carousel-card img {
  transition-property: background-color, border-color, color, fill, stroke, opacity, box-shadow, transform, filter, backdrop-filter;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
  transition-duration: 300ms;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
}

.carousel-card h3 {
  cursor: pointer;
  font-size: 1.125rem;
  line-height: 1.75rem;
  font-weight: 600;
}

.carousel-card h3:hover{
  --tw-text-opacity: 1;
  color: rgba(249, 83, 86, var(--tw-text-opacity));
}

.carousel-card h3 {
  transition-property: background-color, border-color, color, fill, stroke, opacity, box-shadow, transform, filter, backdrop-filter;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 150ms;
  transition-duration: 300ms;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
}

.carousel-card p {
  margin-top: 0.25rem;
  font-size: 0.875rem;
  line-height: 1.25rem;
  --tw-text-opacity: 1;
  color: rgba(156, 163, 175, var(--tw-text-opacity));
}

.carousel-card .heart {
  position: absolute;
  top: 0.5rem;
  right: 0.5rem;
  display: inline-block;
  border-radius: 9999px;
  --tw-bg-opacity: 1;
  background-color: rgba(255, 255, 255, var(--tw-bg-opacity));
  padding: 0.25rem;
}

